description: >-
  Ha csütörtök, akkor Fiesta Latina 😊🎶💃🏻


  November 14-én ismét várunk téged egy szuper latin partyval a HONEY-ban.


  A megszokott régi dallamok mellett sok-sok újdonsággal is várunk benneteket! 😊


  Tánciskolától függetlenül jöhetsz, itt biztosan megtalálod a neked megfelelő zenét, legyen az pörgősebb salsa, timba, vagy bújósabb bachata.


  Kiváló zenei válogatás, jó hangulat, tánchoz alkalmas padlózat, csúcsminőségű fény -és hangtechnika vár rád, egyszóval minden adott egy remek táncos estéhez.


  Belépő: 2000,- Ft 


  Smooth timbák, modern sonok, classik casinók szólnak majd, melyeket megfűszerezünk csipet bachatával, leheletnyi reggaetonnal és merenguével.


  Tehát a hangulat garantált!

  A főszerepben mint minden csütörtökön, most is Kuba és Dominika!


  💙🤍❤️💙🤍❤️💙🤍❤️💙🤍❤️

  EZ HIGGYÉTEK EL, ÉLMÉNY LESZ!!!


  Helyszín:

  HONEY Debrecen

  1024 DEBRECEN, Simonffy utca 1/c – HALKÖZ

  (A régi SeVeN helyén…)

  Asztalfoglalás: +36 70 313 1011


  Ezt most ne bízd a fantáziádra, inkább gyere el és tapasztald meg, mire ez a felhajtás!

  Korhatár 18+


  A Management szigorúan fenntartja a beléptetés jogát.

  www.honeydebrecen.hu


  A HONEY Debrecen területén szervezett események, rendezvények alkalmával a helyszín népszerűsítése, az itt tartott rendezvények dokumentálása, nyilvánosságra hozatala céljából kép és hangfelvételeket rögzít, amelyet a klub közösségi oldalain, weboldalán, népszerűsítésére szolgáló anyagokban nyilvánosságra hoz.

  Az adatkezelés jogalapja vendégünk hozzájárulása, amelyet az esemény, illetve rendezvény ideje alatt a HONEY területére történő belépéssel egyértelműen és kifejezetten megad részünkre.
